import { Search as SearchIcon} from '@mui/icons-material'
import {InputBase, Box} from '@mui/material'

const Component = styled(Box)`
    backgrounf: #fff;
    height: 45px;
    border-bottom: 1px
`


const Search = () => {
    return (
        <Box>
            <Box>
                <Box>
                    <SearchIcon />
                </Box>
                <InputBase />
            </Box>
        </Box>
    )
}

export default Search;
